import React from 'react';
import{
  BrowserRouter as Router,
  Routes,
  Route
  }
  from "react-router-dom"
import './App.css';
import ProductsListPage from './pages/ProductsListPage';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path = '' element = {<ProductsListPage/>}></Route>
        </Routes>
      </Router>

    </div>
  );
}

export default App;
